# World Renewable Energy Consumption
## For Europe, the UK, the US, Canada, and China
### Loren, Owen, and Jackie
### Bates College
### 2022-03-27

---









```r
cleandata &lt;- alldata %&gt;%
  filter(country %in% c("United States", "Canada", "United Kingdom", "Spain", "France", "Germany", "Switzerland", "Italy", "Norway", "Sweden", "Finland", "China", "Brazil", "India", "Russia", "Japan", "New Zealand", "Australia", "Africa", "South Africa"), year &gt;= 1990) %&gt;%
  select(country,
         year,
         wind_energy_per_capita, 
         wind_consumption, 
         wind_share_energy,
         wind_cons_change_twh,
         gdp, solar_energy_per_capita,
         solar_consumption, 
         solar_share_energy, 
         solar_cons_change_twh,
         renewables_energy_per_capita,
         renewables_consumption,
         renewables_cons_change_twh,
         renewables_share_energy, population,
         nuclear_consumption,
         nuclear_share_energy,
         nuclear_cons_change_twh,
         nuclear_energy_per_capita,
         hydro_share_energy,
         hydro_cons_change_twh,
         hydro_energy_per_capita,
         hydro_consumption,
         fossil_cons_change_twh,
         fossil_fuel_consumption,
         fossil_energy_per_capita,
         fossil_share_energy,
         energy_cons_change_twh,
         energy_per_gdp,
         energy_per_capita,
         biofuel_cons_change_twh,
         biofuel_share_energy,
         biofuel_cons_per_capita,
         biofuel_consumption)
```


```r
mostrecentdata &lt;- cleandata %&gt;%
  filter(year == "2018")
```


```r
mostrecentdata &lt;- mostrecentdata %&gt;% 
  left_join(world_spdf2, by = c("country" = "NAME")) %&gt;%
  st_as_sf()
```

style_xaringan(

)

$$\bar{X}=\frac{1}{n}\sum_{i=1}^nX_i$$
```

`$$\bar{X}=\frac{1}{n}\sum_{i=1}^nX_i$$`

Limitations:

1. The source code of a LaTeX math expression must be in one line, unless it is inside a pair of double dollar signs, in which case the starting `$$` must appear in the very beginning of a line, followed immediately by a non-space character, and the ending `$$` must be at the end of a line, led by a non-space character;

1. There should not be spaces after the opening `$` or before the closing `$`.

1. Math does not work on the title slide (see [#61](https://github.com/yihui/xaringan/issues/61) for a workaround).
